module.exports = "<h2>What is SVG?</h2>\n<ul>\n  <li>SVG stands for Scalable Vector Graphics</li>\n  <li>SVG is used to define graphics for the Web</li>\n  <li>SVG is a W3C recommendation</li>\n  <li>SVG graphics do NOT lose any quality if they are zoomed or resized</li>\n  <li>Every element and every attribute in SVG files can be animated</li>\n</ul>\n\n<h2>Differences Between SVG and Canvas</h2>\n<p>SVG is a language for describing 2D graphics in XML.</p>\n\n<p>Canvas draws 2D graphics, on the fly (with a JavaScript).</p>\n\n<p>SVG is XML based, which means that every element is available within the SVG DOM. You can attach JavaScript event handlers for an element.</p>\n\n<p>In SVG, each drawn shape is remembered as an object. If attributes of an SVG object are changed, the browser can automatically re-render the shape.</p>\n\n<p>Canvas is rendered pixel by pixel. In canvas, once the graphic is drawn, it is forgotten by the browser. If its position should be changed, the entire scene needs to be redrawn, including any objects that might have been covered by the graphic.</p>\n\n<div class=\"col-sm-12\">\n  <div class=\"col-sm-4\">\n    <h3>Circle</h3>\n    <svg width=\"100\" height=\"100\">\n      <circle cx=\"50\" cy=\"50\" r=\"40\" stroke=\"green\" stroke-width=\"4\" fill=\"yellow\" />\n    </svg>\n  </div>\n  <div class=\"col-sm-4\">\n      <h3>Rectangle</h3>\n    <svg width=\"400\" height=\"100\">\n      <rect width=\"200\" height=\"100\" style=\"fill:rgb(0,0,255);stroke-width:10;stroke:rgb(0,0,0)\" />\n    </svg>\n  </div>\n  <div class=\"col-sm-4\">\n    <h3>Rectangle with border radius</h3>\n    <svg width=\"200\" height=\"180\">\n      <rect x=\"50\" y=\"20\" rx=\"20\" ry=\"20\" width=\"140\" height=\"150\"\n      style=\"fill:red;stroke:black;stroke-width:5;opacity:0.5\" />\n    </svg>\n  </div>\n</div>\n<div>\n  <div class=\"col-sm-4\">\n    <h3>Gradient Ellipse</h3>\n    <svg height=\"130\" width=\"500\">\n      <defs>\n        <linearGradient id=\"grad1\" x1=\"0%\" y1=\"0%\" x2=\"100%\" y2=\"0%\">\n          <stop offset=\"0%\" style=\"stop-color:rgb(255,255,0);stop-opacity:1\" />\n          <stop offset=\"100%\" style=\"stop-color:rgb(255,0,0);stop-opacity:1\" />\n        </linearGradient>\n      </defs>\n      <ellipse cx=\"100\" cy=\"70\" rx=\"85\" ry=\"55\" fill=\"url(#grad1)\" />\n      <text fill=\"#ffffff\" font-size=\"45\" font-family=\"Verdana\" x=\"50\" y=\"86\">SVG</text>\n      Sorry, your browser does not support inline SVG.\n    </svg>\n  </div>\n  <div class=\"col-sm-4\">\n    <h3>Ellipse</h3>\n    <svg height=\"140\" width=\"500\">\n      <ellipse cx=\"200\" cy=\"80\" rx=\"100\" ry=\"50\"\n      style=\"fill:yellow;stroke:purple;stroke-width:2\" />\n    </svg>\n  </div>\n</div>"

